  return (
    <Container maxWidth="md">
      <Typography variant="h1">
        Lorem, ipsum dolor sit amet consectetur adipisicing elit. Error perferendis voluptate ipsa sapiente natus labore voluptas aperiam nisi itaque dolorum! Quidem accusamus voluptas facere, maiores eos doloribus modi quae eum!
      </Typography>
    </Container>
